package isola.model.ext.grid;import isola.helpers.JsHelper;/** *  * A custom column model for the Ext.grid.PropertyGrid. Generally it should not *  * need to be used directly. *  *  *  * @author Umut Gokbayrak */public class PropertyColumnModel extends ColumnModel {	private static final long serialVersionUID = -1940339625455988782L;	private static final String TAG = "Ext.grid.PropertyColumnModel";		public PropertyColumnModel() {		super();	}		@Override	protected void _postProcessToString() {		super._postProcessToString();	}		@Override	public String toString() {		_postProcessToString();		return "new " + TAG + "(" + JsHelper.printJsObject(this) + ")";	}}